<template>
	<view class="container">
    <view class="top">
      <view class="bg"></view>
      <view class="info-box">
        <view class="avatar">
          <image :src="info.avatar" mode="widthFix"></image>
        </view>
        <view class="info">
          <view class="name text-bold">{{info.name || ''}}</view>
          <view class="good_at text-bold">擅长领域：{{info.good_at_str || ''}}</view>
          <view class="intro line3">{{info.title || ''}}</view>
        </view>
      </view>
    </view>
    
    <!-- <u-sticky> -->
    <view class="tabs">
      <u-tabs-swiper activeColor="#e54c4e" ref="tabs" :list="cates" :current="current" @change="change" :is-scroll="false" swiperWidth="750"></u-tabs-swiper>
    </view>
    <!-- </u-sticky> -->
    
    <view class="swiper-content">
      <swiper class="swiper-box" :current="swiperCurrent" @transition="transition" @animationfinish="animationfinish">
        <swiper-item class="swiper-item">
          <scroll-view style="height: 100%;width: 100%;" @scrolltolower="reachBottom">
            <view class="page-box">
              <view class="lecture">
              	<view class="items flex flex-wrap justify-between">
                  
                  <view class="item" :class="item.flag=='t' ? 'two':'two'" v-for="(item, index) in lists" :key="index" @click="goPage('/pages/lecture/detail?uuid='+item.uuid)">
                    <u-tag class="tag" v-if="item.type==1 && item.live_status==0" text="预告" type="error" mode="dark" shape="circleRight" />
                    <u-tag class="tag" v-else-if="item.type==1 && item.live_status==1" text="直播中" type="success" mode="dark" shape="circleRight" />
                    <u-tag class="tag" v-else text="查看回放" type="info" mode="dark" shape="circleRight" />
                    <image :src="item.thumb" mode="aspectFill"></image>
                    <view class="info">
                      <view class="name">{{item.expert_name || ''}}</view>
                      <u-tag class="cate" :text="item.cate_name || ''" size="mini" bg-color="#bc9f77" mode="dark" shape="circle " />
                      <text class="click">{{item.click}}观看</text>
                    </view>
                  </view>
                  
                </view>
              </view>
              
              <u-loadmore :status="loadStatus"></u-loadmore>
            </view>
          </scroll-view>
        </swiper-item>
        <swiper-item class="swiper-item">
          <scroll-view scroll-y style="height: 100%;width: 100%;" @scrolltolower="reachBottom">
            <view class="page-box intro-box">
              <jyf-parser :html="info.content" ref="article" :tag-style="tagStyle"></jyf-parser>
            </view>
          </scroll-view>
        </swiper-item>
      </swiper>
    </view>
	</view>
</template>

<script>
  import parser from "@/components/jyf-parser/jyf-parser";
  import { getExpertInfo, getExpertLectureData } from '@/api/expert.js';
  import Util from '@/utils/util.js';
	export default {
    components: {
      "jyf-parser": parser
    },
		data() {
			return {
        uuid: '',
				cates:[{
					name: '讲座'
				}, {
					name:  '个人简介'
				}],
        info: [],
        lists: [],
        
				current: 0,
        swiperCurrent: 0,
				sectionCurrent: 0,
				tabCountIndex: 0,
				activeColor: this.$u.color['error'],
				control: true,
        
        loadStatus: 'loadmore',
        page:1,
        limit: 15,
			};
		},
    onLoad(option) {
      this.uuid = option.uuid || '';
      this.getExpert();
      this.getLectureList();
      wx.showShareMenu({
        menus: ["shareAppMessage", "shareTimeline"]
      });
    },
    onShareAppMessage(res) {
      return {
        title: '专家讲座-北京盛世国际拍卖',
        path: '/pages/expert/expert'
      }
    },
    onShareTimeline(){
      return {
        title: '专家讲座-北京盛世国际拍卖',
        imageUrl: ''
      }
    },
    methods:{
      getExpert(){
        var index = this.current;
        var that = this;
        getExpertInfo(this.uuid).then(res=>{
          that.info = res.data.info;
          uni.setNavigationBarTitle({
            title: res.data.info.name
          });
        })
      },
      getLectureList(){
        var that = this;
        if(this.loadStatus=='nomore'){
          return this.$util.Tips({
            title: "没有更多了"
          });
        }
        uni.showLoading();
        getExpertLectureData({page:that.page, limit:that.limit, uuid: that.uuid}).then(res=>{
          let list = res.data.lectures;
          that.lists = that.lists.concat(list);
          let loadend = list.length < that.limit;
          if(loadend){
            that.loadStatus = 'nomore';
          }else{
            that.page++;
          }
          uni.hideLoading();
        })
      },
      // tab栏切换
      reachBottom() {
        //加载数据 仅讲座tab
        if(this.current==0){
          this.getLectureList();
        }
      },
      change(index) {
        this.swiperCurrent = index;
      },
      transition({ detail: { dx } }) {
        this.$refs.tabs.setDx(dx);
      },
      animationfinish({ detail: { current } }) {
        this.$refs.tabs.setFinishCurrent(current);
        this.swiperCurrent = current;
        this.current = current;
      },
      goPage(url, type='navigate'){
        Util.goPage(url, type);
      }
    },
		onReachBottom() {
      if(this.loadStatus == 'nomore') return uni.showToast({
        icon: 'none',
        title: '没有更多了'
      });
      this.loadStatus = 'loading';
      this.getLectureList();
		}
	}
</script>

